import React from 'react'

export default function JavaScript6() {
  return (
    <div className='java-script'>
        <h1>JavaScript ES6 (ECMAScript 2015) is the sixth version of JavaScript that introduced new features and syntax improvements to the language. Here are some key features of ES6:</h1>
    <p>let and const: These are new variable declarations that replace the old var keyword. They provide better scoping rules and help avoid common mistakes that can occur with var.</p>

    </div>
  )
}
